import "./about.css";

export default function About() {
  return (
    <section>
      <div className="about-title">
        <h2>Biz Kimiz?</h2>
        <h4 className="span">HTC Güzellik Salonu</h4>
        <hr/>
      </div>
    </section>
  );
}
